import React from 'react'

import "../global.css"

const Error = () => {
  return (
    <div>
      <h1 style={{color:'white'}}>Something Went Wrong</h1>
      <p style={{color:'white'}}>Page Not Found</p>
    </div>
  )
}

export default Error
